        return (
            <div>
                <h1>Deliveries</h1>
                <Table className="table">
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Date</th>
                            <th>Name</th>
                            <th>Driver</th>
                            <th>&nbsp;</th>
                        </tr>
                    </thead>
                    <tbody>

                        {Object.keys(deliveries).map((item, i) => (
                            <tr key={i+'jack'}>
                                <th scope="row">{item}</th>                            
                                <td key = {i+'col1'}>{deliveries[item].date}</td>
                                <td key = {i+'col2'}>{deliveries[item].name}</td>
                                <td key = {i+'col3'}>{this.state.drivers[deliveries[item].driver_id].name}</td> 
                                <Buttons key={i+'hello'} value={item} />
                            </tr>
                        ))}
                    </tbody>
                </Table>
            </div>
        );
    }
}

export default TableComponent;
